('201002261916451267208205', 'Kapela v Ëele s Richardem KrajËem', '<DIV class=opener>Kapela v Ëele s Richardem KrajËem pr·vÏ v ostravskÈ »EZ arenÏ zvuËÌ na veËernÌ koncert. Vy, co jste nestihli ani praûskou premiÈru, ani brnÏnskou zast·vku t-music Kryötof Tour 2010, nemusÌte zoufat. Port·l iDNES.cz ve spolupr·ci se skupinou nabÌdne dneönÌ koncert v p¯ÌmÈm p¯enosu od 21 hodin.<SPAN class=js-kam-dal>&nbsp;</SPAN> \r\n<DIV class="ico-r h" id=js-kam-dal></DIV></DIV>\r\n<DIV class=text>\r\n<DIV class=bbtext>\r\n<DIV class=equip-tv xmlns:idnes="urn:idnes">\r\n<DIV class="ico equip not4bbtext">Vychutnat si stoprocentnÌ Ëeskou popmusic uû mÏli moûnost <A class=vvword href="http://vyhravejte-s-yetim-na-webu.takeit.cz/kazdy-fanousek-yeti-ziskava-7022395?373657&amp;rtype=V&amp;rmain=178568&amp;ritem=7022395&amp;rclanek=5827556&amp;rslovo=456531&amp;showdirect=1" target=_blank><FONT color=#008000>fanouöci</FONT></A> v Praze (19. 2.) a v BrnÏ (23. 2.). "Masakr absolut... Fakt dÌky <A class=vvword href="http://kontaktocz-internetovy-obchod-cesky-tesin.takeit.cz/air-optix-night-day-6382324?370802&amp;rtype=V&amp;rmain=149039&amp;ritem=6382324&amp;rclanek=5827556&amp;rslovo=459877&amp;showdirect=1" target=_blank><FONT color=#008000>moc</FONT></A>," vzk·zal KrajËo po brnÏnskÈm vystoupenÌ sv˝m fanouök˘m p¯es soci·lnÌ sÌù Facebook, <A class=vvword href="http://wwwparfikycz-parfemy-levne.takeit.cz/cool-water-women-od-davidoff-6287470?370867&amp;rtype=V&amp;rmain=152918&amp;ritem=6287470&amp;rclanek=5827556&amp;rslovo=484706&amp;showdirect=1" target=_blank><FONT color=#008000>kde</FONT></A> se pod jeho "v˝k¯ikem" hromadÌ kladnÈ ohlasy.TÏch se kapela doËkala i v recenzÌch nap¯ÌË mÈdii. "Kryötof si sv˘j ˙spÏch opravdu odpracoval. To se cenÌ," napsal Ond¯ej Bezr z iDNES.cz v hodnocenÌ koncertu, spojenÈho s aktu·lnÌ deskou JeviötÏ (<A href="http://kultura.idnes.cz/krystof-fanynky-z-prazskeho-jeviste-privedl-k-serii-orgastickych-vykriku-1uz-/hudba.asp?c=A100220_115654_hudba_ob"><FONT color=#