('201004132113031271185983', 'AngliËtina rychle, kvalitnÏ a levnÏ. Jiû od 185 KË/NS', '<P>Jsme skupina <SPAN style="FONT-WEIGHT: bold">p¯ekladatel˘</SPAN> a nabÌzÌme kompletnÌ servis sluûeb co se t˝Ëe p¯eklad˘ do angliËtiny a z angliËtiny.P¯eklady do angliËtiny jsme schopni zhotovit velice rychle v r·mci tzv. sluûby - angliËtina on-line (rychl· komunikace internetov˝mi kan·ly).M·me bohatÈ zkuöenosti s p¯eklady pr·vnÌch, ekonomick˝ch, technick˝ch a jin˝ch text˘ (jak jednoduch˝ch tak i velmi odborn˝ch).</P>', 'ne', 'bez', '', '', 'prava', '', '200903'),
('201004142223511271276631', 'D·le nabÌzÌme tlumoËenÌ na obchodnÌch jedn·nÌch atd', '<p>ZajistÌme kvalitnÌ sluûby na ˙zemÌ »eskÈ Republiky i v cizinÏ.Pokud chcete \r\nzÌskat kvalitnÌ sluûby za rozumnou cenu, jsme tu pro V·s - P¯eklady \r\nangliËtina.</p>', 'ne', 'bez', '', '', 'prava', '', '200903'),
('201004132043511271184231', 'Pozv·nka na prvnÌ roËnÌk konference Internet Developer Forum', '<p>IDF 2010 je nov· celodennÌ konference od Internet Infa, tentokr·t zamÏ¯en· na p¯edevöÌm na webovÈ v˝voj·¯e a ty, kte¯Ì s nimi p¯ich·zejÌ do styku.</p>', 'ne', 'bez', '', '', 'prava', '', '200903'),
