('200911211947371258829257', 'Carlos Fuentes: Poh¯benÈ zrcadlo', 'Rozs·hl˝ esej jednoho z nejv˝znamnÏjöÌch mexick˝ch spisovatel˘ o hled·nÌ kulturnÌ identity äpanÏlska a Hisp·nskÈ Ameriky v pr˘bÏhu dÏjin od nejstaröÌch dob do souËasnosti. St¯ÌdavÏ vûdy z jednoho b¯ehu Atlantiku na druh˝ nahlÌûÌ autor na klÌËovÈ historickÈ ud·losti äpanÏlska a Hisp·nskÈ Ameriky, kterÈ se v˝znamn˝m zp˘sobem podÌlely na utv·¯enÌ jejich kulturnÌ identity', 'ano', 'pohrbene_zrcadlo', '250', '180', 'ano', 'prvnÌ str·nka ES', 'text v mutaci ES'),
('200911221805121258909512', 'Elena Poniatowska: Zt¯eötÏn· sedma', 'Monografie sedmi v˝znamn˝ch mexick˝ch umÏlkyÚ 20. stoletÌ, kterÈ se snaæily prosadit v oborech, v nichæ do tÈ doby dominovali jejich muæπtÌ kolegovÈ. Prost¯ednictvÌm portrÈt˘ malÌ¯ek Fridy Kahlo, MarÌe Izquierdo, Nahui Olin, b·snÌ¯ky Pity Amor a spisovatelek Rosario Castellanos, Eleny Garro a Nellie Campobello zprost¯edkov·v· autorka Ëten·¯i obraz kulturnÌho æivota Mexika 20. stoletÌ.', 'ano', 'strestena_sedma', '250', '180', 'ne', '', ''),
('200911221810451258909845', 'Elena Poniatowska: Drah˝ Diego, objÌm· TÏ Quiela', 'Siln˝ emocion·lnÌ p¯ÌbÏh malÌ¯ky ruskÈho p˘vodu Angeliny BeloffovÈ a mexickÈho malÌ¯e Diega Rivery, na jehoû pozadÌ autorka evokuje atmosfÈru kosmopolitnÌ Pa¯Ìûe v prvnÌ polovinÏ 20. stoletÌ, prost¯edÌ ruskÈ emigrace a umÏleck˝ch avantgardnÌch kruh˘, p¯ipomÌn· nadÏje a touhy pov·leËnÈ Evropy upÌrajÌcÌ se k novÈmu porevoluËnÌmu Mexiku. Ps·no formou fiktivnÌch dopis˘, kterÈ malÌ¯ka psala Diegu Riverovi z Pa¯Ìûe do Mexika.', 'ano', 'drahy_diego', '250', '180', 'ne', '', ''),
('200911221814101258910050', 'JosÈ JimÈnez Lozano: OËi ikony', '<BR>ZamyölenÌ öpanÏlskÈho autora nad tÌm, co naöÌ sekul·rnÌ civilizaci mohou ¯Ìci dÌla ranÈho st¯edovÏku, jak jim dnes m·me rozumÏt a co v minulosti sdÏlovala naöim p¯edk˘m.', 'ano', 'ocni_ikony', '250', '180', 'ne', '', '');
