INSERT INTO `osobnosti` (`date`, `id`, `jmeno`, `popis`) VALUES
('2008-11-23', '1', 'Jan Otto', 'Jan Otto æil v letech 1841 &#8211; 1916. UsÌdlil se na Zbraslavi jiæ v roce 1873 spolu se svou rodinou v pronajatÈm domku na Z·visti. V tomto domÏ æil tÈæ VÌtÏzslav H·lek. V roce 1881 koupil Jan Otto p¯ÌzemnÌ vilku obr·cenou k VltavÏ. Zde rodina pob˝vala aæ do roku 1912, kdy architekt Otakar Novotn˝ postavil velkou rodinou vilu. Jan Otto vlastnil jedno z nejvÏtπÌch vydavatelstvÌ. Byl zakladatelem Ëasopisu Zlat· Praha, obnovitelem Ëasopisu SvÏtozor, mnohÈ Ëasopisy tiskl &#8211; nap¯. LumÌr, OsvÏta. V jeho tzv. knihovn·ch a sbÌrk·ch - SvÏtov· knihovna, Rusk· knihovna, Lacin· knihovna n·rodnÌ - vych·zela ¯ada dÏl zn·m˝ch i tÏch mÈnÏ zn·m˝ch. Jan Otto byl tÈæ velk˝m p¯Ìznivcem divadla. TehdejπÌ ochotnick˝ soubor ho jmenoval Ëestn˝m Ëlenem. SvÈ stÏæejnÌ dÌlo &#8222;Ott˘v slovnÌk nauËn˝&#8220; vydal v pr˘bÏhu let 1889 &#8211; 1909.To, æe starπÌ Riegr˘v SlovnÌk nauËn˝ by bylo t¯eba nahradit novÏjπÌm a d˘kladnÏjπÌm, si v 1. polovinÏ 80. let uvÏdomovali nejvÌce Tom·π Masaryk a mlad˝ nakladatel Jan Otto. Otto na ja¯e 1884 povÏ¯il Jakuba MalÈho, b˝valÈho redaktora Riegrova slovnÌku, sestavenÌm koncepce novÈho dÌla, ale Mal˝ v b¯eznu 1885 zem¯el. Po nÏm uzav¯el Otto nakladatelskou smlouvu 22. 9. 1885 s Masarykem; Masaryk mÏl podle nÌ ¯Ìdit redakci slovnÌku. JednotlivÈ oblasti pozn·nÌ mÏli na starosti odbornÌ redakto¯i, jejichæ v˝bÏr byl sloæit˝, protoæe leckdy existovala averze mezi starπÌmi univerzitnÌmi profesory a mlad˝mi spolupracovnÌky Athenaea, kte¯Ì mÏli b˝t j·drem Masarykova t˝mu. Entuziasmus, jÌmæ Masaryk strhl ostatnÌ spolupracovnÌky, zpochybÚoval J. Goll, kter˝ poukazoval na nevyzr·lost nÏkter˝ch vÏdnÌch obor˘ v ËeskÈm prost¯edÌ. Vyd·v·nÌ slovnÌku mÏlo zaËÌt v roce 1886 a dokonËeno mÏlo b˝t bÏhem nejv˝πe osmi let. Ale boj o pravost Rukopis˘ vπe znaËnÏ zkomplikoval a zbrzdil. Jan Otto se dostal do zoufalÈ situace, neboª vybudovan˝ okruh spolupracovnÌk˘ byl rozh·d·n a Masaryk se stal v Ëele redakce ne˙nosn˝m. Ani O. HostinskÈmu jako Masarykovu n·stupci se nepoda¯ilo bojkot starπÌch vÏdeck˝ch osobnostÌ zlomit. Nakonec byla sestavena namÌsto πÈfredaktora kolektivnÌ redakce ze star˝ch, kterou na opl·tku ignorovali mnozÌ Masarykovi p¯Ìvræenci. Ani ˙porn· p¯esvÏdËovacÌ snaha podnikatele Otta ¯adu z nich nezÌskala. SlovnÌk nauËn˝ byl ukonËen poslednÌm 28. dÌlem v roce 1908. Dodnes je nejvÏtπÌ Ëeskou pracÌ tohoto typu a dokonce se doËkal reprintu a poËÌtaËovÈ verze. DoporuËujeme k p¯eËtenÌ p¯ekr·snou knihu Jan Otto autora Jaroslava ©vehly.'),
('2008-11-28', '2', 'VitÏzslav H·lek', 'VÌtÏzslav H·lek æil v letech 1835 &#8211; 1874. Na Zbraslavi pob˝val jen kr·tce. Æil v malÈm domku, Ëp. 84 na Z·visti. Na pr˘ËelÌ domu byla tÈæ pamÏtnÌ deska. Bohuæel d˘m padl za obÏª povodni v lÈtÏ 2002. H·lka okouzlila zdejπÌ p¯Ìroda a klid, r·d sed·val na b¯ezÌch Vltavy a pozoroval vora¯e. »erpal zde jistÏ inspiraci pro mnoh· sv· dÌla. Za zmÌnku stojÌ nap¯. sbÌrky lyrick˝ch verπ˘ &#8211; V p¯ÌrodÏ, VeËernÌ pÌsnÏ nebo sbÌrka povÌdek &#8211; Na statku a v chaloupce.'),
('2008-12-02', '3', 'Petr Æitavsk˝', 'Petr Æitavsk˝ &#8211; P¯esnÈ datum narozenÌ nenÌ zn·mo. Narodil se v rozmezÌ let 1260-1270. Zbraslavsk˝m opatem byl v letech 1316 &#8211; 1338. Jeho Kronika zbraslavsk· je po KosmovÏ kronice nejd˘leæitÏjπÌm historick˝m pramenem z doby poslednÌch P¯emyslovc˘. Je z·roveÚ nejobs·hlejπÌm dÌlem svÈ doby. KromÏ popisu mÌstnÌch ud·lostÌ nabÌzÌ r˘zn· historick· fakta v daleko πirπÌm kontextu. ZabÌr· obdobÌ vl·dy P¯emysla Otakara II., V·clava II. a Jana LucemburskÈho. Petr Æitavsk˝ a jeho dÌlo je d˘kazem, æe tehdejπÌ panovnÌci mÏli ve sv˝ch diplomatick˝ch sluæb·ch osoby povolanÈ, se skuteËn˝m rozhledem v politice, historii a diplomacii.'),
('2008-12-08', '4', 'Dr. Miroslav Tyrπ', 'Dr. Miroslav Tyrπ &#8211; (1832 &#8211; 1884) b˝val hostem Zbraslavi pouze v letnÌch mÏsÌcÌch. Na tyto vz·cnÈ chvilky upozorÚuje pamÏtnÌ deska na domÏ Ëp. 65 na n·b¯eæÌ. Miroslav Tyrπ se vÏnoval p¯ÌrodnÌm vÏd·m, estetice, antickÈ kultu¯e. Byl zakladatelem masovÈ tÏlesnÈ v˝chovy a tÏlov˝chovnÈ metody. Z·kladnÌ myπlenkou bylo budov·nÌ tÏla i ducha. Jako zakladatel Sokola tÈæ publikoval v Ëasopisech Sokol a SbornÌk sokolsk˝. MÈnÏ zn·m· je skuteËnost, æe p¯edn·πel na technice a byl v˝raznou univerzitnÌ osobnostÌ.'),
('2008-12-12', '5', 'Jan Kaπka', 'Jan Kaπka (1810-1869) se narodil na Zbraslavi. Do naπÌ kulturnÌ historie se nesmazatelnÏ zapsal jako vynikajÌcÌ herec, ale takÈ jako spisovatel a p¯ekladatel. ZbraslavskÈ prost¯edÌ mu bylo inspiracÌ pro nejedno dÌlo &#8211; nap¯. Hezk· pletaËka, NesmÏl˝ æenich. Kaπka se nejd¯Ìve vyuËil krejËÌm, pozdÏji odeπel do Prahy, kde se vÏnoval herectvÌ. Jeho svÈr·znÈ komickÈ sklony u nÏj objevil J. K. Tyl a angaæoval ho ve svÈm divadle. Odtud odeπel spolu s cel˝m souborem do divadla StavovskÈho. V roce 1842 se Kaπka vyd·v· na profesion·lnÌ hereckou dr·hu. SvÈ hereckÈ schopnosti a nad·nÌ uplatnil v rolÌch komick˝ch i charakternÌch. &#8211; nap¯. role Kalafuny ve StrakonickÈm dud·kovi, sen·tor Brabantio v ShakespearovÏ Othelovi. Zem¯el v roce 1869 jako Ëlen ProzatÌmnÌho divadla. PokraËovatelem Kaπkov˝ch ide·l˘ je takÈ obnovenÈ zbraslavskÈ ochotnickÈ divadlo nesoucÌ jeho jmÈno. VzpomÌnkou na tohoto velik·na naπeho obrozeneckÈho divadla je pamÏtnÌ deska na jeho rodnÈm domÏ (d˘m v dneπnÌ KaπkovÏ ulici).'),
('2008-12-16', '6', 'Vladislav VanËura', 'Vladislav VanËura (1891 &#8211; 1942) zpoË·tku p˘sobil na Zbraslavi jako lÈka¯ a aæ pozdÏji se zaËal vÏnovat pouze psanÌ. Z jeho dÏl vyberme nap¯. Peka¯ Jan Marhoul, Kubula a Kuba Kubikula, RozmarnÈ lÈto, MarkÈta Lazarov·, ⁄tÏk do BudÌna, Luk kr·lovny Dorotky, Obrazy z dÏjin n·roda ËeskÈho. Vladislav VanËura zem¯el v roce 1942 v koncentraËnÌm t·bo¯e. Dodnes nese ulice, v nÌæ bydlel se svou rodinou, jeho jmÈno a na jeho pam·tku zde takÈ stojÌ pomnÌk s bustou. Jeho æena Ludmila byla vyhl·πenou zbraslavskou lÈka¯kou. Dcera, Alena Santarov·, pracovala jako redaktorka. Svou tvorbu zamÏ¯ila na malÈ Ëten·¯e.'),
('2008-12-18', '7', 'Adam Zaluæansk˝ ze Zaluæan', 'Adam Zaluæansk˝ ze Zaluæan (1555 &#8211; 1613) byl profesorem botaniky, p¯edn·πel ¯eËtinu, latinu a vÏnoval se lÈka¯sk˝m vÏd·m. Na Z·visti zaloæil botanickou zahradu. Rudolfem II. byl pov˝πen do rytÌ¯skÈho stavu dÌky svÈmu botanickÈmu spisu Herbarium. Kv˘li svÈ velkÈ l·sce k Lidmile se vzdal hodnosti dÏkana a p˘sobil potÈ jiæ jen jako lÈka¯ vyhl·πen˝ tÈæ sv˝mi znalostmi bylink·¯stvÌ. K jeho velkÈ l·sce se v·æe povÏst Dub a lÌpa Zaluæansk˝ch.'),
('2008-12-21', '8', 'Otakar Nickerle', 'M·lo zn·m· je skuteËnost, æe Zbraslav se sv˝m okolÌm hr·la d˘leæitou roli v pracovnÌm æivotÏ Otakara Nickerle. Tento p¯ÌrodovÏdec æijÌcÌ v letech 1838 &#8211; 1920 se vÏnoval p¯edevπÌm entomologii. V okolÌ Zbraslavi tr·vil spoustu Ëasu, zejmÈna toho pracovnÌho. Jeden z d˘leæit˝ch p¯ÌrodovÏdn˝ch objev˘ uËinil pr·vÏ zde. Nalezl mravenËÌ kr·lovnu rodu Anergates atratulu, coæ je vz·cn˝ druh mravenc˘, kter˝ na pr·ci v mraveniπti kromÏ sv˝ch vlastnÌch soukmenovc˘ najÌm· takÈ tzv. mravenËÌ otroky rodu Tetramorium. Velk· Ë·st v˝sledk˘ sbÏratelskÈ Ëinnosti Otakara Nickerle poch·zÌ pr·vÏ z okolÌ Zbraslavi a mnoho z jeho n·lez˘ najdeme v p¯Ìrodopisn˝ch sbÌrk·ch N·rodnÌho muzea .'),
('2009-01-18', '9', 'Josef Richard VilÌmek', 'Josef Richard VilÌmek, πÈf velkÈho nakladatelstvÌ, æil v letech 1860 &#8211; 1938. VyuËil se u otce, praktickÈ zkuπenosti zÌsk·v· v zahraniËÌ. V roce 1886 p¯ebÌr· nakladatelsk˝ podnik po svÈm otci. NakladatelstvÌ ve Sp·lenÈ ulici bylo roku 1889 zniËeno poæ·rem. Obnoveno je roku 1901. MnohÈ ho pojilo s druh˝m velik·nem Janem Ottou. Produkce nakladatelstvÌ dosahuje rozmachu za J.R.VilÌmka ml., kter˝ se zamÏ¯uje spÌπe na lidovÈ vrstvy. J·dro tvo¯ila lepπÌ lidov· Ëetba. CÌlevÏdomÏ vyd·v· literaturu pro dÏti a ml·deæ s vysoce kvalitnÌ ˙pravou. StavÏl na p¯edplatnÈm pro πkoly. Vyd·v· Ëasopis /Mal˝ Ëten·¯/, kter˝ je prvnÌm profesion·lnÏ vyd·van˝m Ëasopisem pro dÏti a ml·deæ. Jako prvnÌ u n·s zakupuje vydavatelsk· pr·va vËetnÏ origin·lnÌ ilustrace na rom·ny Julese Vernea. Roku 1891 vyd·v· cestopis / Z Prahy k BaltickÈmu mo¯i v balÛnu /. Tento let v balÛnu J.R. VilÌmek opravdu uskuteËnil s kapit·nem Godardem tÈhoæ roku, i kdyæ cÌlem cesty byla p˘vodnÏ Moskva. D·le nap¯Ìklad vyd·val detektivnÌ novely, ilustrovanÈ rom·ny Ëi humoristickÈ knihy, ale takÈ mapy, pr˘vodce a jÌzdnÌ ¯·dy. VilÌmek æil se svou rodinou ve vilce nazvanÈ &#8222;Ve stÌnu lÌpy&#8220; na Z·visti. Jeho otec skoro 50 let redigoval HumoristickÈ listy zaloæenÈ jiæ roku 1858. Jeho ostr· satira vπak byla p¯ÌËinou mnoha potÌæÌ s tehdejπÌmi rakousk˝mi ˙¯ady.'),
('2009-02-28', '10', 'Eduard Beaufort', 'Nedaleko vrchu HavlÌna se roku 1830 usadil dalπÌ z nakladatel˘, kter˝ spojil sv˘j æivot se ZbraslavÌ, a to Eduard Beaufort. Roku 1884 zaloæil tento nakladatel tisk·rnu, kde se jako prvnÌ v tehdejπÌm Rakousku pouæÌval s·zecÌ stroj Linotype s Ëeskou kl·vesnicÌ. Beaufort byl jednÌm s tÏch, kte¯Ì prosazovali osmihodinovou pracovnÌ dobu typograf˘. V roce 1903 zaloæil prvnÌ slÈv·rnu pÌsmen. Vyd·val nap¯. P¯Ìtel domoviny, Levn· ilustrovan· knihovna, publikoval dÌla modernÌch Ëesk˝ch autor˘ i dÌla Sienkiewicze, Vernea a mnoh˝ch dalπÌch.'),
('2009-02-29', '11', 'Saπa Raπilov', 'Saπa Raπilov 1891 &#8211; 1995 byl vyuËen˝m typografem. PozdÏji vystupoval v r˘zn˝ch kabaretech a potÈ se stal hercem N·rodnÌho divadla. Nejd¯Ìve bydlel na lodi ukotvenÈ nedaleko N·rodnÌho divadla, teprve roku 1931 se usadil na Zbraslavi ve vilce nedaleko Vltavy. jeho charakternÌ a p¯edevπÌm komickÈ role se zapsaly nesmazatelnÏ do filmovÈ historie i do naπich srdcÌ. KromÏ herectvÌ se tÈæ pokusil o scen·ristiku &#8211; film P¯ijdu hned. ©irok· rodina Saπi Raπilova æije ve vilce romanticky nazvanÈ /Mamince/ dodnes.'),
('2009-03-02', '12', 'JaromÌr Vejvoda', 'JaromÌr Vejvoda (1902 &#8211; 1988) je z¯ejmÏ nejzn·mÏjπÌm ËlovÏkem, kter˝ sv˘j æivot spojil se ZbraslavÌ. Vejvoda sloæil p¯es pades·t skladeb, z nichæ nejzn·mÏjπÌ je ©koda l·sky z roku 1929. Ve svÏtÏ je zn·mÏjπÌ pod n·zvem Roll out the barrels a ¯Ìk· se, æe tato pÌseÚ &#8222;pomohla vyhr·t 2. svÏtovou v·lku&#8220;. Mnoho n·rod˘ si tento n·pÏv p¯ivlastnilo a mnoho lidÌ ve svÏtÏ si dodnes myslÌ, æe je to pr·vÏ jejich n·rodnÌ. Vejvodova kapela, jÌæ byl JaromÌr Vejvoda Ëlenem od sv˝ch Ëtrn·cti let takÈ p¯ispÏla k πÌ¯enÌ vlastenectvÌ. NÏkolik let si jÌ objedn·vali krajanÈ z VÌdnÏ na svÈ plesy. D˘stojnou vzpomÌnkou na slavnÈho skladatele je v dneπnÌ dobÏ takÈ festival Vejvodova Zbraslav, kter˝ se kaædoroËnÏ kon· koncem z·¯Ì. NÏkolik let je nedÌlnou souË·stÌ zbraslavsk˝ch kulturnÌch tradic a zÌskal si renomÈ nejen v tuzemsku. KaædoroËnÏ se na festivalu objevÌ i nÏkter˝ ze zahraniËnÌch dechov˝ch orchestr˘. Na hladkÈm pr˘bÏhu festivalu se kromÏ po¯·dajÌcÌ agentury Orfea nemalou mÏrou podÌlejÌ potomci JaromÌra Vejvody, ale takÈ Zbraslavsk· kulturnÌ spoleËnost.'),
('2009-03-28', '13', 'Kapit·n Emanuel V. Voska', 'Kapit·n Emanuel V. Voska ˙ËastnÌk I. odboje v Americe, spoluzakladatel »eskoslovenskÈho ËervenÈho k¯Ìæe a soci·lnÏ demokratick˝ publicista, byl vlastenec i dobrodruh jehoæ z·sluhy si vysoce cenil i prezident T. G. Masaryk . Svou ËinnostÌ se podÌlel na poloæenÌ z·klad˘ novÈho »eskoslovenskÈho st·tu. Spolupracoval takÈ s porf. T.G. Masarykem, kter˝ v tÈ dobÏ byl hlavnÌm p¯edstavitelem malÈ a ale vlivnÈ realistickÈ strany. Emanuel Voska odeπel koncem 19. stoletÌ do Spojen˝ch st·t˘, kde dÌky svÈ podnikavosti znaËnÏ zbohatl. Do Evropy se vracÌ v obdobÌ kdy Rakousko-Uhersko vyhl·silo Srbsku v·lku a v·leËn˝ konflikt se postupnÏ rozπi¯uje po celÈ EvropÏ. EvropÏ se chtÏl p¯esvÏdËit o pravÈm stavu situace a p¯i tÈto p¯Ìleæitosti uskuteËnil setk·nÌ s T.G. Masarykem. P¯i tÈto n·vπtÏvÏ probÌhala diskuse o v·lce a o boji proti Rakousku. Zde takÈ vyvstala myπlenka o zaloæenÌ kur˝rnÌ sluæby mezi »echami a zahraniËÌm, kterou by zorganizoval Voska z »echoameriËan˘ kte¯Ì navπtÏvujÌ starou vlast. KrajanÈ v Americe mÏli svojÌ Ëinnost soust¯edit na Rakousko-uherskÈ diplomaty. Po n·vratu z Evropy se stal nejbliæπÌm spolupracovnÌkem Frantiπek Kopeck˝, kter˝ byl ˙¯ednÌkem rakousko-uherskÈho gener·lnÌho konzul·tu. Voska zaËal zÌsk·vat zadræenÈ dopisy a ˙¯ednÏ tajnÈ dokumenty, kterÈ p¯ed·val britskÈmu n·mo¯nÌmu ataπÈ kapit·nu Guyi Gruntovi, kter˝ v USA koordinoval veπkerou zpravodajskou Ëinnost. Voska zadræoval takÈ rakousko-uherskÈ vl·dnÌ penÌze od r˘zn˝ch konzul·t˘ a snaæil se znemoæÚovat konfiskaci majetku v »ech·ch na Slovensku vπude kde se jednalo o slovanskÈ zemÏ v r·mci HabsburskÈ monarchie. Mezi lety 1914 - 1915 vytvo¯il Voska ze svÈ iniciativy organizaci, kterou povÏ¯oval r˘zn˝mi ˙koly, kterÈ mÏli odhalovat nez·konnou Ëinnost Centr·lnÌch mocnostÌ a tÌm zvyπovat v˝znam »ech˘ pro boj Spojenc˘. ChtÏl p¯esvÏdËit americkÈ obËany o nep¯·telsk˝ch ˙myslech NÏmc˘ a Rakuπan˘ a naopak o nezbytnosti americkÈ pomoci st·t˘m Dohody. AmeriËtÌ Ëeπi by