nit·rnÌ pomoc pro ©panÏlsko kde vypukla vzpoura proti novÈ vl·dÏ vyπlÈ z parlamentnÌch voleb. TakÈ zaËal vyd·vat nov˝ Ëasopis ©panÏlsko. Na poË·tku nacistickÈ okupace Voska se svou rodinou uprchl do Spojen˝ch st·t˘. Ve Spojen˝ch st·tech pom·hal zÌsk·vat lidi do novÏ se tvo¯ÌcÌ americkÈ v˝zvÏdnÈ sluæby OSS. On s·m se uplatnil v ˙¯adu pro v·leËnÈ informace OWI. V tomto ˙¯adu byl povÏ¯en vykon·v·nÌm πpion·æe. Roku 1943 byl vysl·n do Istambulu, odkud nav·zal spojenÌ se Slovenskem a s protektor·tem. Pracoval tam dva roky. Po n·vratu do republiky se pustil sedmdes·tilet˝ Voska opÏt do podnik·nÌ a do spoleËenskÈho æivota. Po roce 1948 byl novou vl·dnoucÌ mocÌ povaæov·n za nebezpeËnÈho vyzvÏdaËe a v roce 1950 zatËen STB a zanedlouho byly zatËeny i jeho t¯i dcery. On s·m byl obvinÏÚ ze πpion·æe ve prospÏch USA. Jeho jmÈno figurovalo v procesu s Rudolfem Sl·nsk˝m. Po Ëty¯ech letech vyπet¯ovacÌ vazby odsoudili Emanuela Vosku na deset let do æal·¯e. Do vÏzenÌ mu nesmÏli p¯ÌbuznÌ posÌlat ani balÌËky s potravinami. Jiæ hodnÏ star˝ Voska byl vÌc nemocn˝ neæ zdrav˝, p¯esto rodina æ·dala o jeho propuπtÏnÌ. Æ·dost byla zamÌtnuta s od˘vodnÏnÌm, æe vÏzeÚ nebyl dostateËnÏ p¯evychov·n. Teprve zaË·tkem roku 1960 mu trest byl ze zdravotnÌch d˘vod˘ na πest mÏsÌc˘ p¯eruπen. Kapit·n Emanuel voska 1. dubna umÌr· doma mezi sv˝mi, ale st·le jeπtÏ jako vÏzeÚ.');
